import React from "react";
import "./styles.css"
import { BrowserRouter, Routes, Link } from "react-router-dom";

function Login() {
    return (
        <div>
            <div className="loginContainer">
                <div className="loginPage">
                    <form>
                        <input type="text" placeholder="Username" />
                    </form>
                </div>
            </div>
        </div>
    );
}

export default Login;
